import React from 'react';

const UserListItem = (props) => {
    return (
        <div>
            <ul class="list-group">
                {props.users.map((user,index) => {
                    return (
                    <li class="list-group-item list-group-item-action">{user.username}</li>
                    )
                })}
            </ul>    
        </div>
    );
};

export default UserListItem;
